<h5>ED-00004: Netflix Prize Data</h5>
<p>The <a href="http://www.netflixprize.com/">Netflix Prize</a> was a competition devised by Netflix to improve the accuracy of its recommendation system.  To facilitate this Netflix released real ratings about movies from the users of the system.  Any set of movies can be transformed into an election via a process outlined by Mattei, Forshee, and Goldsmith (reference below).</p><p>The data sets posted below correspond 100 random 3 and 4 candidate elections drawn from Data Set 1 in the paper , "An Empirical Study of Voting Rules and Manipulation with Large Datasets."  The elements numbered 1 - 100 are all 3 candidate elections and the elements 101 - 201 are all 4 candidate elections. </p>

<p><h6>Required Citations</h6><p><ul> 
<li> <a href="http://scholar.google.com/scholar?as_q=The+Netflix+Prize">The Netflix Prize.</a> James Bennett and Stan Lanning. Proceedings of The KDD Cup and Workshops, 2007. </li>
</ul></p>

<p><h6>Selected Citations Using This Dataset</h6><p><ul> 
<li> <a href="http://scholar.google.com/scholar?as_q=An+Empirical+Study+of+Voting+Rules+and+Manipulation+with+Large+Datasets">An Empirical Study of Voting Rules and Manipulation with Large Datasets.</a> Nicholas Mattei, James Forshee, and Judy Goldsmith. 4th International Workshop on Computational Social Choice (COMSOC), 2012. </li>
<li> <a href="http://scholar.google.com/scholar?as_q=Empirical+Evaluation+of+Voting+Rules+with+Strictly+Ordered+Preference+Data">Empirical Evaluation of Voting Rules with Strictly Ordered Preference Data.</a> Nicholas Mattei. 2nd International Conference on Algorithmic Decision Theory (ADT), 2011. </li>
</ul></p>

